description:
基于supersocket的商用项目维护开发
1.修复supersocket部分bug
2.移植到.NET CORE|NETStandard.Library 平台
3.简化服务器配置
4.将之前的app.config配置移植到json中
在appsettings.json中增加配置
 "SimpleSocketConfig": {
    "ServerTypeNiceName": "IcbTerminalService",
    "ServerTypeFullName": "ICheBao.Service,ICheBao.Protocols",
    "KeepAliveTime": 10,
    "Port": 7000,
    "ListenBacklog": 2147483647,
    "MaxConnectionNumber": 65535,
    "IdleSessionTimeOut": 300,
    "ClearIdleSessionInterval": 60,
    "ClearIdleSession": true,
    "ReceiveBufferSize": 128,
    "SendBufferSize": 128,
    "DisableSessionSnapshot": true,
    "Name": "IcbTerminal",
    "MaxCompletionPortThreads": 10000,
    "PerformanceDataCollectInterval": 120,
    "DisablePerformanceDataCollector": false
  },

启动代码：
  var simpleCfg = IocUnity.Get<SimpleSocketConfig>();
           
            var ssCfg = simpleCfg.ConvertSocketServiceCfg();

            Stopwatch startWatch = new Stopwatch();

            startWatch.Start();
            var bootstrap = BootstrapFactory.CreateBootstrapFromServerCfg(ssCfg);
            startWatch.Stop();
            Console.WriteLine("CSpuerTcp初始化工厂耗时：{0}ms", startWatch.ElapsedMilliseconds);

            startWatch.Reset();
            startWatch.Start();
            var isSuccess = bootstrap.Initialize();
            startWatch.Stop();
            Console.WriteLine("CSpuerTcp启动耗时：{0}ms",startWatch.ElapsedMilliseconds);

